import React, { useState } from "react";

const CheckInPage = () => {
  const [flightNumber, setFlightNumber] = useState("");
  const [clientId, setClientId] = useState(""); // de test
  const [lastName, setLastName] = useState("");
  const [passportNumber, setPassportNumber] = useState("");
  const [luggageOption, setLuggageOption] = useState("");
  const [checkInStatus, setCheckInStatus] = useState<string | null>(null);

  const handleCheckIn = async (e: React.FormEvent) => {
  e.preventDefault();

  if (flightNumber && lastName && passportNumber) {
    try {
      const response = await fetch("https://localhost:7239/api/CheckIn", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          IDZbor: parseInt(flightNumber),
          IDClient: 1, // aici trebuie să pui un client valid existent în DB
          NrPasaport: parseInt(passportNumber),
          TipBagaj: luggageOption || "Fără bagaj",
          CheckedIN: true,
        }),
      });

      if (!response.ok) {
        throw new Error("Eroare la check-in");
      }

      setCheckInStatus("Check-in reușit! Ai finalizat procedura de check-in.");
    } catch (err) {
      console.error(err);
      setCheckInStatus("A apărut o eroare la check-in.");
    }
  } else {
    setCheckInStatus("Te rugăm să completezi toate câmpurile.");
  }
};


  return (
    <div className="w-full min-h-screen bg-gray-100 flex justify-center items-center py-10 px-4">
      <div className="bg-white p-8 rounded-xl shadow-lg max-w-md w-full">
        <h2 className="text-3xl font-semibold mb-6 text-center text-gray-700">
          Completează informațiile pentru Check-in
        </h2>

        <form onSubmit={handleCheckIn} className="space-y-6">
          <div>
            <label className="block text-lg font-semibold text-gray-600">Număr Zbor</label>
            <input
              type="number"
              value={flightNumber}
              onChange={(e) => setFlightNumber(e.target.value)}
              className="w-full border p-3 rounded mt-2"
              placeholder="Introdu numărul zborului"
              required
            />
          </div>

          <div>
            <label className="block text-lg font-semibold text-gray-600">ID Client</label>
            <input
              type="number"
              value={clientId}
              onChange={(e) => setClientId(e.target.value)}
              className="w-full border p-3 rounded mt-2"
              placeholder="Introdu ID-ul clientului"
              required
            />
          </div>

          <div>
            <label className="block text-lg font-semibold text-gray-600">Nume de familie</label>
            <input
              type="text"
              value={lastName}
              onChange={(e) => setLastName(e.target.value)}
              className="w-full border p-3 rounded mt-2"
              placeholder="Introdu numele tău"
              required
            />
          </div>

          <div>
            <label className="block text-lg font-semibold text-gray-600">Număr Pașaport</label>
            <input
              type="number"
              value={passportNumber}
              onChange={(e) => setPassportNumber(e.target.value)}
              className="w-full border p-3 rounded mt-2"
              placeholder="Introdu numărul pașaportului"
              required
            />
          </div>

          <div>
            <label className="block text-lg font-semibold text-gray-600">Selectează tipul de bagaj</label>
            <select
              value={luggageOption}
              onChange={(e) => setLuggageOption(e.target.value)}
              className="w-full border p-3 rounded mt-2"
            >
              <option value="">Fără bagaj</option>
              <option value="Bagaj de cabină">Bagaj de cabină (max. 8kg)</option>
              <option value="Bagaj de cală">Bagaj de cală (max. 23kg)</option>
              <option value="Bagaj suplimentar">Bagaj suplimentar (cost adițional)</option>
            </select>
          </div>

          <button
            type="submit"
            className="w-full bg-blue-600 text-white py-3 rounded hover:bg-blue-700 transition"
          >
            Check-in
          </button>
        </form>

        {checkInStatus && (
          <div className="mt-6 text-center text-lg font-semibold text-gray-800">
            <p>{checkInStatus}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default CheckInPage;
